import logo from './logo.svg';
import './App.css';

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <img src='https://e7.pngegg.com/pngimages/95/672/png-clipart-giant-panda-bear-garden-ornament-table-art-giant-panda-animals-carnivoran.png' className="App-logo" alt="logo" />

      </header>
    </div>
  );
}

export default App;
